const myChart = echarts.init(document.getElementById("col3"));

function draw(data) {
        data.forEach((graph) => {
          graph.nodes.forEach((node) => {
            node.label = {
              show: true,
            };
            node.name = node.id;
            node.symbolSize = 10;
            graph.links.forEach((link) => {
              if (link.source == node.id) {
                node.symbolSize += 2;
              }
            });
          });
        });

        const option = {
          dataZoom: [
            {
              type: "inside",
            },
          ],
          title: {
            text: "Authors Network",
          },
          legend: [
            {
              selectedMode: "single",
              data: data.forEach((graph) => {
                return graph.name;
              }),
            },
          ],

          series: data.map((graph) => {
            return {
              name: graph.name,
              type: "graph",
              layout: "force",
              force: {
                // initLayout: 'circular'
                // gravity: 0
                repulsion: 50,
                edgeLength: 30,
              },
              data: graph.nodes,
              links: graph.links,
              roam: true,
              label: {
                position: "right",
                formatter: "{b}",
              },
              itemStyle: {
                shadowBlur: 10,
                shadowColor: "rgba(25, 100, 150, 0.5)",
                shadowOffsetY: 5,
                color: {
                  type: "radial",
                  x: 0.4,
                  y: 0.3,
                  r: 1,
                  colorStops: [
                    {
                      offset: 0,
                      color: "rgba(129, 227, 238, 0.5)",
                    },
                    {
                      offset: 1,
                      color: "rgba(25, 183, 207, 0.5)",
                    },
                  ],
                },
              },
              lineStyle: {
                color: "source",
                curveness: 0,
              },
              emphasis: {
                focus: "adjacency",
                lineStyle: {
                  width: 5,
                },
              },
            };
          }),
        };
        myChart.setOption(option);
      }

